/**
 * FVU Logo Data
 * Auto-generated base64 data URL for PDFMake
 * Source: assets/images/FVU-logo-white-bg.png (white background version)
 * Original: 1374x1105 pixels, flattened RGBA->RGB
 * 
 * To regenerate: python tools/convert-logo-to-base64.py
 */

export const FVU_LOGO_BASE64 = 'data:image/png;base64,';

// Logo dimensions for PDF (maintains aspect ratio)
// Original: 1374x1105, Aspect ratio: 1.243
export const FVU_LOGO_WIDTH = 80;
export const FVU_LOGO_HEIGHT = 64;

/**
 * Validate logo data URL format
 * @returns {boolean} True if valid
 */
export function validateLogoData() {
  if (!FVU_LOGO_BASE64.startsWith('data:image/png;base64,')) {
    console.error('Invalid logo data URL format');
    return false;
  }
  if (FVU_LOGO_BASE64.length < 1000) {
    console.warn('Logo data URL seems too short');
    return false;
  }
  try {
    const base64String = FVU_LOGO_BASE64.split(',')[1];
    atob(base64String.substring(0, 100));
    return true;
  } catch (error) {
    console.error('Logo base64 data is corrupted:', error);
    return false;
  }
}
